import React, { Component } from "react";
import "./App.css";
import Button from "./components/button";
import Table from "./components/table";
import NavBar from "./components/navBar";

class App extends Component {
  render() {
    return (
      <div>
        <NavBar
          title="Fantasy Calculator"
          pages={["Customize Rules", "About"]}
        />
        <div className="text-center text-secondary" style={{marginTop:'10%'}}>
          <h1 style={{ marginBottom: "5%" }}>
            Welcome to the NBA Fantasy Ranking Calculator
          </h1>
          <div
            style={{ marginTop: "5%", marginLeft: "10%", marginRight: "10%" }}
          >
            <Table query="http://localhost:5002/rankplayers?mode=official" />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
